FactoryGirl.define do
  factory :image, class: Hashie::Mash do |i|
    i.sequence(:file_name) { |n| "image number #{n}" }
    content_type "image/png"
    trait :hundred_k_image do
      data "data:image/png;base64,"
    end

    trait :ten_k_image do
      data "data:image/png;base64,"
    end

    trait :one_k_image do
      data "data:image/png;base64,"
    end
  end

end
